export function CheckSVG() {
	return (
		<svg
			xmlns="http://www.w3.org/2000/svg"
			width="512"
			height="512"
			viewBox="0 0 512 512"
		>
			<polyline
				points="416 128 192 384 96 288"
				style={{
					fill: "none",
					stroke: "currentcolor",
					strokeLinecap: "square",
					strokeMiterlimit: 10,
					strokeWidth: 44,
				}}
			/>
		</svg>
	);
}
